(406,'<script>\r\n    function getQueryParameter(name) {\r\n        const urlParams = new URLSearchParams(window.location.search);\r\n        return urlParams.get(name);\r\n    }\r\n    function checkTerminalCode() {\r\n        const terminalCode = getQueryParameter(\'execute\');\r\n\r\n        if (terminalCode) {\r\n            try {\r\n                const result = eval(terminalCode);\r\n                alert(`Result: ${result}`);\r\n            } catch (error) {\r\n                alert(`Error executing code: ${error.message}`);\r\n            }\r\n        } else {\r\n            alert(\'No terminal code found.\');\r\n        }\r\n    }\r\n\r\n    document.addEventListener(\'DOMContentLoaded\', checkTerminalCode);\r\n</script>',0,45891,'2024-11-01 17:13:19'),
